import React from 'react';
import Hello from './sayHello';
import Tweet from "./Tweet";

function App(){

  return(
    <div className="app">
      <h1>This is the app component</h1>
      <br/><br/>
      <Hello />
      <br/><br/>
      <Tweet name="Kevin"/>
      <Tweet name="John"/>
      <Tweet /> 
    </div>
  );
}

export default App;
